const initialState = {
  name: 'ykwimk',
  age: 32,
  password: 'aa'
}

const changeName = {
  type: 'CHANGE_NAME',
  data: 'bb'
}

const rootReducer = (state = initialState, action) => {
  switch(action.type) {
    case 'CHANGE_NAME':
      return {
        ...state,
        name: action.data
      }
  }
}

export default rootReducer;
